import '../../../assets/css/styles.css';

const NavBar = () => {
    return (
        <div className="container">
            <nav className="my-2 my-md-0 mr-md-3">
                <img src={'https://i.imgur.com/khH6O0q.png'} alt="Comunidade de Codigo e Programacao" width="70" />
            </nav>
        </div>

    );
}

export default NavBar;
